// src/components/Orders.js
import { useEffect, useState } from "react";
import { Wrapper } from "./Wrapper";

export const Orders = () => {
  const [productId, setProductId] = useState("");
  const [quantity, setQuantity] = useState("");
  const [message, setMessage] = useState("Buy your favorite product");
  const [pricePreview, setPricePreview] = useState(null);
  const [orderId, setOrderId] = useState(null);
  const [status, setStatus] = useState(null);

  
  useEffect(() => {
    if (!productId) {
      setPricePreview(null);
      setMessage("Buy your favorite product");
      return;
    }

    (async () => {
      try {
        const resp = await fetch(`http://localhost:8000/products/${productId}`);
        if (!resp.ok) throw new Error("Product not found");
        const product = await resp.json();
        const price = parseFloat(product.price) * 1.2; // price + fee
        setPricePreview(price.toFixed(2));
        setMessage(`Your product price is $${price.toFixed(2)}`);
      } catch (e) {
        setPricePreview(null);
        setMessage("Product not found");
      }
    })();
  }, [productId]);

  // Submit a new order
  const submit = async (e) => {
    e.preventDefault();
    setMessage("Placing your order...");

    const resp = await fetch("http://localhost:8001/orders", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ id: productId, quantity }),
    });

    if (!resp.ok) {
      setMessage("Failed to place order.");
      return;
    }

    const order = await resp.json();
    setOrderId(order.pk);
    setStatus(order.status);
    setMessage(`Order ${order.pk} created: ${order.status}`);
  };

  // Poll the order status until it changes from "pending"
  useEffect(() => {
    if (!orderId) return;

    const interval = setInterval(async () => {
      const resp = await fetch(`http://localhost:8001/orders/${orderId}`);
      if (!resp.ok) {
        setMessage("Failed to fetch order status.");
        clearInterval(interval);
        return;
      }
      const o = await resp.json();
      setStatus(o.status);
      setMessage(`Order ${orderId} is now ${o.status}`);
      if (o.status !== "pending") {
        clearInterval(interval);
      }
    }, 2000);

    return () => clearInterval(interval);
  }, [orderId]);

  return (
    <Wrapper>
      <div className="py-5 text-center">
        <h2>Checkout Form</h2>
        <p className="lead">{message}</p>
      </div>

      <form onSubmit={submit}>
        <div className="row g-3">
          <div className="col-sm-6">
            <label className="form-label">Product ID</label>
            <input
              className="form-control"
              value={productId}
              onChange={(e) => setProductId(e.target.value)}
            />
          </div>

          <div className="col-sm-6">
            <label className="form-label">Quantity</label>
            <input
              type="number"
              className="form-control"
              value={quantity}
              onChange={(e) => setQuantity(e.target.value)}
            />
          </div>
        </div>

        <hr className="my-4" />
        <button className="w-100 btn btn-primary btn-lg" type="submit">
          Buy
        </button>
      </form>

      {pricePreview && (
        <div className="mt-4">
          <strong>Price Preview:</strong> ${pricePreview}
        </div>
      )}

      {orderId && (
        <div className="mt-4">
          <strong>Order ID:</strong> {orderId}
          <br />
          <strong>Status:</strong> {status}
        </div>
      )}
    </Wrapper>
  );
};
